import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View ,ImageBackground, Button, Alert, Modal } from 'react-native';


const image={uri:"https://reactjs.org/logo-og.png"};
export default function App() {

  // const imagesrc2={"Aquaman.jpg"};
  return (
    <View style={styles.container}>
      <StatusBar 
        animated={true}
        backgroundColor="#61dafb"></StatusBar>
      {/* <ImageBackground source={require('./Aquaman.jpg')} resizeMode="cover" style={styles.image}> */}
      <ImageBackground source={image} resizeMode="cover" style={styles.image}>

        <Text style={styles.text}>Open up App.js to start working on your app!</Text>
        <View >
          <Button title="hello" onPress={() => Alert.alert('Button pressed')} style={outerHeight=50}></Button>
        </View>

        </ImageBackground>


      <Modal style={styles.modal}>
          <Text>Yo Yo Bitches!</Text> 
        </Modal>
    </View>

  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  image: {
    flex: 1,
    color:"#f0f",
    alignSelf:"stretch",
    justifyContent: "center"
  },
  button:{
    flex:1,
    alignSelf:"auto",
    fontSize:40,
    height:"50",
    width:"50",
  },
  text:{
    // color: "white",
    color: "#61dafb",
    fontSize: 42,
    lineHeight: 84,
    fontWeight: "bold",
    textAlign: "center",
    backgroundColor: "#000000c0"
  },
  modal:{
    flex:3,
    color:"#f0f",
    justifyContent:'center',
    alignSelf:"center",
  },
});
